An example of refining an extern struct and impl can be found here . A simpler example just involving structs can be found here . The syntax for an extern spec on a struct is very similar to that for a function. Once again, each line in the example happens to correspond to a step. #[extern_spec(std::string)]
#[flux_rs::refined_by(len: int)]
struct String; Add the #[extern_spec] attribute. This attribute optionally takes a path; in the above example, this is std::string. You can use this path to qualify the function. So in the above example, the struct we are targeting has the full path of std::string::String. Add a #[flux_rs::refined_by(...)] attribute. This is required for any extern spec on a struct. Right now these attributes behave as if they were opaque (#[flux_rs::opaque]), although we may support non-opaque extern structs. Write a stub for the extern struct. If you do the above, you can use std::string::String as if it were refined by an integer index. The syntax for an extern impl is a little different than that for functions or structs. #[extern_spec(std::string)]
impl String { #[flux_rs::sig(fn() -> String[0])] fn new() -> String; #[flux_rs::sig(fn(&String[@n]) -> usize[n])] fn len(s: &String) -> usize;
} You still need to add the #[extern_spec] attribute, with the same optional argument of the path as above. You need to write out the impl block for the struct you want to refine. This struct does not need an extern spec, since by refining the impl you're only refining its methods. Write an extern spec for each function you wish to refine (this may be a subset). This is written just like a function extern spec with the caveat that the self parameter is not presently supported. So for example, instead of writing fn len(&self) -> usize;, you need to write fn len(s: &String) -> usize;. If you do the above, you can use the above methods ofstd::string::String as if they were refined. You shouldn't need to know the details, but here's how the above two macros expand. For structs: #[flux_rs::extern_spec]
#[allow(unused, dead_code)]
#[flux_rs::refined_by(len: int)]
struct __FluxExternSpecString(std::string::String); For impls (this was translated manually so there might be some bugs): #[allow(unused, dead_code)]
struct __FluxExternImplStructString; #[allow(unused, dead_code)]
impl __FluxExternImplStructString { #[flux_rs::extern_spec] #[flux_rs::sig(fn() -> String[0])] #[allow(unused, dead_code)] fn __flux_extern_spec_new() -> String { std::string::String::new::<>() } #[flux_rs::extern_spec] #[flux_rs::sig(fn(&String[@n]) -> usize[n])] #[allow(unused, dead_code)] fn __flux_extern_spec_len(s: &String) -> usize { std::string::String::len::<>(s) }
}

