In many situations, we want to lend a value to another function that actually changes the value's (refinement) type upon exit. For example, consider the following function to increment a reference to a non-negative i32 #[flux_rs::sig(fn (p: &mut i32{v:0 <= v}))]
fn incr(p: &mut i32) { *p += 1
} Recall that Flux is modular in that the only information it has about incr is what is said in the signature. The signature for incr only says p remains non-negative: Flux does not know that incr actually increments the value of p. Hence, Flux fusses that the following assert may fail even though its patently obvious that it will succeed! To verify test_incr we need a signature for incr that says that its output is indeed one greater [2] than its input. Flux extends Rust with the notion of strong references of the form &strg T which refine Rust's &mut T to grant exclusive access to the underlying T. Crucially, strong references also let us specify how the type is updated when the function exits [3] . Thus, we can use strong references to type incr as #[flux_rs::sig(fn(p: &strg i32[@n]) ensures p:i32[n+1])]
fn incr(p: &mut i32) { *p += 1
} The Flux signature refines the plain Rust one to specify that p is a strong reference to an i32, the input type of *p is i32[n], and the output type of *p is i32[n+1]. With this specification, Flux merrily checks test_incr, by determining that the refinement parameter @n is 10 and hence, that upon return x: i32[11].

